description:
Цена снижена до момента пока не продан автомобиль, который меня интересует!!! Спешите!!! Цена за наличку!!!

Уникальный автомобиль, который собирает все взгляды прохожих! Без внимания не останетесь! Всего 12 автомобилей в продаже в России!!! 
ПТС - оригинал, по ПТС 2009 г., страна изготовитель - Франция, кузов - кабриолет, 4 хозяина. АКПП, антиблокировочная система ABS, ESP, ПЭП, ГУР, 6 airbag, аудиосистема c MP3, CD, сидения с обогревом, центральный замок, 2 ЗОННЫЙ КЛИМАТ- КОНТРОЛЬ, КРУИЗ- КОНТРОЛЬ, КАМЕРА ЗАДНЕГО ВИДА, все электрозеркала, охранная система, диски R17, абсолютно НОВАЯ ЛЕТНЯЯ РЕЗИНА, салон - кожа, датчик датчик дождя, датчик света, тонированные стекла, обогрев зеркал, бортовой компьютер, регулировка руля (в 2 пл.) Маленький расход, маленький налог. 

Начать можно с климатической установки – «фирменный» двухзонный климат-контроль "Bi-zone" у Peugeot 308 CC может менять параметры своей работы в зависимости – открыта или закрыта крыша автомобиля.
Впервые в мире передние сиденья купе-кабриолета оснащены не только привычными фронтальными и боковыми подушками безопасности, но и так называемыми "головными" боковыми подушками безопасности. Тем самым, у водителя и пассажиров Пежо 308 CC защищены все части тела, независимо от положения человека в кресле.
Полный набор "тормозной электроники" включает в себя ESP Bosch 8.1 (систему динамической стабилизации движения), ASR (противобуксовочную систему), ABS (антиблокировочную систему тормозов), AFU (система помощи при экстренном торможении) и REF (электронный регулятор тормозных сил).
Как и подобает "премиуму" - хромированных деталей в интерьере салона здесь в избытке. 
Салон у Peugeot 308 CC согласно высокому статусу – из благородной кожи «Claudia». 

В первый раз кабриолет этого класса получил "воздушный шарф". 
Но только Peugeot 308 CC, впервые в мире, получил систему Airwawe – возможность регулировки не только температуры и интенсивности, но и … направления потока тёплого воздуха! 
Дополняет систему Airwawe съёмный интерцептор для исключения порывов ветра в салоне при движении с полностью открытым верхом – как у знаменитых Porsche 911 Cabrio и Boxster.
Дизайн салона отличает отделка высококачественной благородной кожей.
Кроме перечисленного, оборудование Пежо 308 СС  включает в себя: 
- исполнение приборной панели "Solar Eclipse";
- центральный замок с ДУ и автоматической блокировкой при начале движения; 
- электростеклоподъёмники не только передних дверей, но и задних "треугольных" стёкол (!);
- электропривод регулировки и складывания боковых зеркал заднего вида, оснащённых электрообогревом; 
- противотуманные фары; 
- MP3-аудиосистему "WIP Sound" с 6 динамиками и джойстиком ДУ; 
- бортовой компьютер; 
- сенсор дождя и систему автоматического включения ближнего света фар;
- задний парктроник, показания которого выводятся на центральный дисплей;
- регулируемый подогрев сидений; 
- наружные зеркала заднего вида с электроприводом складывания;
- электропривод регулировок водительского сиденья с памятью;
- комплексная функция памяти настроек (зеркала заднего вида + кресло водителя);
- легкосплавные 17-дюймовые колёсные диски,
и многое другое…
Peugeot 308 СС комплектуется мощным турбодвигателем, созданным в содружестве с BMW:
1.6 л THP 140 л.с. c автоматической адаптивной 6-ступенчатой коробкой передач Aisin AT6, имеющей спортивный, экономичный и зимний режимы, а также систему "ручного" переключения "Tiptronic System Porsche®".
